export default function Login({ setPage }) {
  const login = () => {
    localStorage.setItem("user", "logged");
    setPage("chat");
  };

  return (
    <div>
      <h2>Login (Mock)</h2>
      <input placeholder="Name" />
      <input placeholder="Phone Number" />
      <button onClick={login}>Login</button>
    </div>
  );
}
